class Solution:
    def thirdMax(self, nums: List[int]) -> int:
        first = max(nums)
        while(True):
            if first in nums:
                nums.remove(first)
            else:
                break

        if(nums==[]): return first

        second = max(nums)
        while(True):
            if second in nums:
                nums.remove(second)
            else:
                break

        new = 0
        if(first > second): new = first
        else: new = second

        if(nums==[]): return new
        third = max(nums)
        return third

class Solution {
    public int thirdMax(int[] nums) {
        Arrays.sort(nums);
        for(int i = 0;i<nums.length/2;++i){
            int temp = nums[i];
            nums[i] = nums[nums.length-1-i];
            nums[nums.length-1-i] = temp;
        }
        int count = 1;
        int prev = nums[0];
        for(int i = 1;i<nums.length;++i){
            if(nums[i]!=prev){
                count+=1;
                prev = nums[i];
            }
            if(count==3) return nums[i];
        }
        return nums[0];
    }
}

