class Solution:
    def climbStairs(self, n: int) -> int:
        steps = 0
        if n == 1:
            return 1
        hashmap = {}
        k = n
        #climbing 
        def climb(k):
            if k in hashmap:
                return hashmap[k]
            if k == 1:
                return 1
            if k == 2:
                return 2
            if k not in hashmap:
                hashmap[k] = climb(k-1) + climb(k-2)
            return climb(k-1)+climb(k-2)

        steps += climb(k)
        return steps

