class Solution(object):
    def thirdMax(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        nums.sort()
        num=[]
        for i in nums:
            if i not in num:
                num.extend([i])
        if len(num)<3:
            return num[-1]
        return num[-3]

class Solution:
    def thirdMax(self, nums: List[int]) -> int:
        nums = set(nums)
        nums = sorted(nums)
        if len(nums) >= 3:
            return nums[len(nums)-3]
        return nums[len(nums)-1]

int thirdMax(int* nums, int numsSize){
    for(int i=0;i<numsSize;i++){
        for(int j=i+1;j<numsSize;j++){
            if(nums[i]<nums[j]){
                int temp=nums[i];
                nums[i]=nums[j];
                nums[j]=temp;
            }
        }
    }
    int c=0,d=1;
    for(int i=0;i<numsSize-1;i++){
        if(nums[i]!=nums[i+1]){
            d++;
            if(d==3){
                return nums[i+1];
            }
        }
    }

    return nums[0];
}

